import React from 'react';
import { Typography, Link, IconButton } from '@mui/material';
import { GitHub, LinkedIn } from '@mui/icons-material';
import { styled } from '@mui/system';

const FooterContainer = styled('footer')({
  backgroundColor: '#333',
  color: '#fff',
  padding: '20px',
  textAlign: 'center',
  position: 'relative',
  bottom: 0,
  width: '100%',
  overflow: 'hidden',
  maxHeight: '10vh',
});

const Footer = () => {
  return (
    <FooterContainer>
      <Typography variant="body1">
        © {new Date().getFullYear()} Júlio Gonçalves.
      </Typography>
      <Typography variant="body2">
        All rights reserved.
      </Typography>
      <div style={{ marginTop: '10px' }}>
        <IconButton color="inherit" component={Link} href="https://github.com/your-github-profile">
          <GitHub />
        </IconButton>
        <IconButton color="inherit" component={Link} href="https://www.linkedin.com/in/your-linkedin-profile">
          <LinkedIn />
        </IconButton>
      </div>
    </FooterContainer>
  );
};

export default Footer;
